INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】後衛で、攻撃と敵の弱体化の二役で輝く女商人。\n生ける金貨が詰まった財布を投げつける不意打ちや、\n金貨の嵐を巻き起こす攻撃で、相手の防御を大きく崩す。", 35, 0, 1, "クレジッタ", "くれじった", 0, 118001, 3, "2024/09/25 12:00:00", 450, 0, 751, "2024/09/30 11:59:59", 0, 118001, 35, 1, 118001, 118001, 1.97, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、美しい旋律を紡ぎ支援する幽寂の歌姫。\n味方の強化と敵の弱体化の両方面での補助を行い、さらに\n召喚した鉱石の飛竜との波状攻撃により敵を鎮圧する。", 7, 0, 2, "ランファ", "らんふぁ", 0, 118101, 3, "2025/02/28 12:00:00", 450, 0, 782, "2025/03/03 18:59:59", 19, 118101, 21, 1, 118101, 118101, 2.07, 0, 0, 0);
