INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 6, 0, 1, "アユミ（怪盗）", "あゆみ", 0, 121501, 3, "2024/04/12 12:00:00", 450, 0, 590, "2024/04/15 14:59:59", 12, 121501, 6, 1, 121501, 121501, 2.0, 0, 0, 0);
