INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 3, 0, 1, "シノブ（パイレーツ）", "しのぶ", 0, 122001, 3, "2022/05/03 19:00:00", 450, 0, 380, "2030/12/31 15:00:00", 14, 122001, 3, 0, 122001, 122001, 1.425, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 35, 0, 1, "アオイ（キャンプ）", "あおい", 0, 122101, 1, "2024/04/18 15:00:00", 450, 0, 731, "2030/12/31 15:00:00", 9, 122101, 35, 1, 122101, 122101, 1.97, 0, 0, 0);
