INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 43, 0, 2, "ヴァンピィ", "うぁんぴぃ", 0, 122301, 3, "2022/06/15 15:00:00", 450, 0, 564, "2030/12/31 15:00:00", 0, 122301, 43, 0, 122301, 122301, 1.425, 0, 0, 0);
