INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 7, 0, 2, "キョウカ（サマー）", "きょうか", 0, 122701, 3, "2022/08/15 15:00:00", 450, 0, 812, "2030/12/31 15:00:00", 0, 122701, 7, 0, 122701, 122701, 1.92, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 1, 0, 1, "ミソギ（サマー）", "みそぎ", 0, 122801, 1, "2024/07/16 15:00:00", 450, 0, 237, "2030/12/31 15:00:00", 0, 122801, 1, 1, 122801, 122801, 2.295, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 5, 0, 1, "ミミ（サマー）", "みみ", 0, 122901, 3, "2024/08/26 19:00:00", 450, 0, 361, "2024/08/31 11:59:59", 0, 122901, 5, 1, 122901, 122901, 2.25, 0, 0, 0);
