INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 7, 0, 2, "マホ（エクスプローラー）", "まほ", 0, 123101, 3, "2022/09/03 19:00:00", 450, 0, 793, "2030/12/31 15:00:00", 0, 123101, 7, 0, 123101, 123101, 1.795, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 3, 0, 1, "アヤネ（エクスプローラー）", "あやね", 0, 123201, 3, "2022/09/15 15:00:00", 450, 0, 256, "2030/12/31 15:00:00", 0, 123201, 3, 0, 123201, 123201, 1.425, 0, 0, 0);
