INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 4, 0, 1, "ノゾミ（リベレイター）", "のぞみ", 0, 124801, 3, "2025/02/20 12:00:00", 450, 0, 423, "2025/02/24 11:59:59", 0, 124801, 0, 1, 124801, 124801, 2.14, 0, 0, 0);
