INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 5, 0, 1, "ムイミ（リベレイター）", "むいみ", 0, 125001, 3, "2025/02/20 12:00:00", 450, 0, 221, "2025/02/24 11:59:59", 0, 125001, 0, 1, 125001, 125001, 1.965, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 8, 0, 1, "タマキ（カフェ）", "たまき", 0, 125101, 3, "2023/03/03 19:00:00", 450, 0, 825, "2030/12/31 15:00:00", 0, 125101, 47, 0, 125101, 125101, 2.24, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 4, 0, 1, "モニカ（カフェ）", "もにか", 0, 125201, 3, "2023/03/10 12:00:00", 450, 0, 463, "2030/12/31 15:00:00", 0, 125201, 4, 0, 125201, 125201, 1.965, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 6, 0, 1, "コッコロ（レンジャー）", "こっころ", 0, 125301, 3, "2024/04/12 12:00:00", 450, 0, 752, "2024/04/15 14:59:59", 0, 125301, 6, 1, 125301, 125301, 2.07, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 8, 0, 1, "シオリ（レンジャー）", "しおり", 0, 125401, 3, "2023/04/10 12:00:00", 450, 0, 710, "2030/12/31 15:00:00", 0, 125401, 8, 0, 125401, 125401, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 7, 0, 2, "ジータ（ウォーロック）", "じーた", 0, 125501, 3, "2024/05/10 12:00:00", 450, 0, 443, "2024/05/15 14:59:59", 0, 125501, 50, 1, 125501, 125501, 1.92, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 51, 0, 1, "ビカラ", "びから", 0, 125601, 3, "2024/05/10 12:00:00", 450, 0, 267, "2024/05/15 14:59:59", 0, 125601, 0, 1, 125601, 125601, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 7, 0, 2, "カリン（アルケミスト）", "かりん", 0, 125701, 1, "2023/04/30 12:00:00", 450, 0, 579, "2030/12/31 15:00:00", 0, 125701, 9, 1, 125701, 125701, 2.24, 0, 0, 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 3, 0, 1, "リリ（フォールン）", "りり", 0, 125801, 3, "2023/04/17 12:00:00", 450, 0, 464, "2030/12/31 15:00:00", 0, 125801, 0, 0, 125801, 125801, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("", 1, 0, 0, "カヤ（リベレイター）", "かや", 0, 0, 3, "2015/04/01 15:00:00", 0, 0, 0, "2030/12/31 15:00:00", 0, 0, 1, 1, 125901, 125901, 0.0, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 0, 1, "クリア（フォールン）", "くりあ", 0, 126001, 3, "2023/10/31 12:00:00", 450, 0, 406, "2030/12/31 15:00:00", 0, 126001, 0, 0, 126001, 126001, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 44, 0, 2, "プレシア（フォールン）", "ぷれしあ", 0, 126101, 3, "2023/11/15 15:00:00", 450, 0, 480, "2030/12/31 15:00:00", 0, 126101, 53, 0, 126101, 126101, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 3, 0, 2, "イリヤ（儀装束）", "いりや", 0, 126201, 3, "2024/06/10 12:00:00", 450, 0, 568, "2024/06/15 14:59:59", 0, 126201, 3, 1, 126201, 126201, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 7, 0, 2, "ユキ（儀装束）", "ゆき", 0, 126301, 3, "2023/06/15 15:00:00", 450, 0, 456, "2030/12/31 15:00:00", 0, 126301, 9, 0, 126301, 126301, 2.07, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 1, 0, 1, "クローチェ", "くろーちぇ", 0, 126401, 3, "2025/02/28 12:00:00", 450, 0, 373, "2025/03/03 18:59:59", 0, 126401, 1, 1, 126401, 126401, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 7, 0, 2, "ライラエル", "らいらえる", 0, 126501, 3, "2025/02/28 12:00:00", 450, 0, 740, "2025/03/03 18:59:59", 0, 126501, 0, 1, 126501, 126501, 1.965, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 7, 0, 2, "ネネカ（サマー）", "ねねか", 0, 126601, 3, "2024/07/11 12:00:00", 450, 0, 650, "2024/07/15 14:59:59", 0, 126601, 7, 1, 126601, 126601, 2.04, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 5, 0, 1, "アキノ（サマー）", "あきの", 0, 126701, 1, "2023/06/30 12:00:00", 450, 0, 224, "2030/12/31 15:00:00", 0, 126701, 5, 1, 126701, 126701, 1.965, 0, 0, 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 5, 0, 1, "ユカリ（サマー）", "ゆかり", 0, 126801, 3, "2023/07/15 15:00:00", 450, 0, 159, "2030/12/31 15:00:00", 0, 126801, 5, 0, 126801, 126801, 1.97, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 7, 0, 2, "ランファ（サマー）", "らんふぁ", 0, 126901, 3, "2024/08/09 12:00:00", 450, 0, 682, "2024/08/12 11:59:59", 0, 126901, 21, 1, 126901, 126901, 1.965, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 2, 0, 1, "クウカ（サマー）", "くうか", 0, 127001, 1, "2023/07/31 12:00:00", 450, 0, 133, "2023/08/14 20:59:59", 0, 127001, 52, 1, 127001, 127001, 1.97, 0, 0, 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 5, 0, 1, "シノブ（サマー）", "しのぶ", 0, 127101, 3, "2024/08/09 12:00:00", 450, 0, 255, "2024/08/12 11:59:59", 0, 127101, 46, 1, 127101, 127101, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 7, 0, 2, "キャル（編入生）", "きゃる", 0, 127201, 3, "2024/10/10 12:00:00", 450, 0, 804, "2024/10/13 11:59:59", 0, 127201, 7, 1, 127201, 127201, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 8, 0, 1, "スズナ（編入生）", "すずな", 0, 127301, 3, "2023/09/15 15:00:00", 450, 0, 750, "2030/12/31 15:00:00", 0, 127301, 8, 0, 127301, 127301, 2.09, 0, 0, 0);
