INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 4, 0, 1, "サレン（サラサリア）", "されん", 0, 127501, 3, "2024/11/11 12:00:00", 450, 0, 304, "2024/11/18 11:59:59", 0, 127501, 4, 1, 127501, 127501, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 4, 0, 1, "ルカ（サラサリア）", "るか", 0, 127601, 3, "2023/10/15 15:00:00", 450, 0, 157, "2030/12/31 15:00:00", 0, 127601, 4, 0, 127601, 127601, 1.965, 0, 0, 0);
