INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 7, 0, 2, "ヴルム", "うるむ", 0, 127801, 3, "2024/10/18 12:00:00", 450, 0, 706, "2030/12/31 15:00:00", 0, 127801, 47, 0, 127801, 127801, 1.965, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 5, 0, 2, "ペコリーヌ（クリスマス）", "ぺこりーぬ", 0, 127901, 3, "2024/12/09 12:00:00", 450, 0, 372, "2024/12/15 14:59:59", 0, 127901, 5, 1, 127901, 127901, 1.965, 0, 0, 0);
