INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 7, 0, 2, "エキドナ（サマー）", "えきどな", 0, 132001, 3, "2024/09/13 12:00:00", 450, 0, 775, "2024/09/25 11:59:59", 0, 132001, 21, 1, 132001, 132001, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 13, 0, 1, "レム（サマー）", "れむ", 0, 132101, 3, "2024/08/31 12:00:00", 450, 0, 146, "2024/09/13 11:59:59", 0, 132101, 24, 1, 132101, 132101, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 7, 0, 2, "ノゾミ（アルケミスト）", "のぞみ", 0, 132201, 3, "2024/09/30 12:00:00", 450, 0, 721, "2024/10/10 11:59:59", 0, 132201, 7, 1, 132201, 132201, 1.84, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 7, 0, 2, "ライラエル（クリスマス）", "らいらえる", 0, 132801, 3, "2024/11/30 12:00:00", 450, 0, 750, "2024/12/09 11:59:59", 0, 132801, 0, 1, 132801, 132801, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 5, 0, 2, "イオ（クリスマス）", "いお", 0, 132901, 3, "2024/12/09 12:00:00", 450, 0, 748, "2030/12/31 15:00:00", 0, 132901, 46, 0, 132901, 132901, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 0, 0, 1, "グレイス", "ぐれいす", 0, 133001, 3, "2025/02/28 12:00:00", 450, 0, 234, "2025/03/03 18:59:59", 0, 133001, 0, 1, 133001, 133001, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 4, 0, 1, "モニカ（ニューイヤー）", "もにか", 0, 133201, 1, "2024/12/31 12:00:00", 450, 0, 296, "2030/12/31 15:00:00", 0, 133201, 22, 1, 133201, 133201, 2.09, 0, 0, 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 4, 0, 2, "サレン（ニューイヤー）", "されん", 0, 133501, 3, "2025/01/03 19:00:00", 450, 0, 718, "2025/01/15 14:59:59", 0, 133501, 22, 1, 133501, 133501, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 0, 0, 1, "メドゥーサ", "めどぅーさ", 0, 133601, 3, "2025/01/20 12:00:00", 450, 0, 445, "2025/01/31 11:59:59", 0, 133601, 0, 1, 133601, 133601, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 8, 0, 2, "ラビリスタ（アルファ）", "らびりすた", 0, 133701, 3, "2025/01/31 12:00:00", 450, 0, 717, "2025/02/10 11:59:59", 0, 133701, 0, 1, 133701, 133701, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 7, 0, 2, "ネネカ（アルファ）", "ねねか", 0, 133801, 3, "2025/02/20 12:00:00", 450, 0, 759, "2025/02/28 11:59:59", 0, 133801, 0, 1, 133801, 133801, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 6, 0, 1, "クリスティーナ（アルファ）", "くりすてぃーな", 0, 133901, 3, "2025/02/10 12:00:00", 450, 0, 228, "2025/02/20 11:59:59", 0, 133901, 0, 1, 133901, 133901, 2.09, 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES ("【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 0, 0, 2, "フィオ", "ふぃお", 0, 134001, 3, "2025/02/28 12:00:00", 450, 0, 746, "2025/03/03 18:59:59", 0, 134001, 0, 1, 134001, 134001, 2.09, 0, 0, 0);
